  CREATE OR REPLACE NONEDITIONABLE PACKAGE "SAPIENS"."SM2_K_LD_MDSQL" IS

  /**---------------------------------------------------------------------------------------------------
  || Paquete que se utiliza para la generaci√≥n y ejecuci√≥n de scripts
  */ ---------------------------------------------------------------------------------------------------
  ------------------
  -- Constantes
  ------------------
  C_RESULTADO_OK    CONSTANT NUMBER(1) := 1;
